import React from "react";
import styled from "styled-components";

const ContainerWrapper = styled.div`
  position: relative;
  padding: 16px 10%;
  border: 2px solid #3E2723;
  border-radius: 4px;
  height: 100%;

  &::before {
    content: "";
    position: absolute;
    top: -10px;
    left: 6%;
    width: 88%;
    height: 7px;
    border-radius: 50% 50% 0 0;
    background-color: #3E2723;
  }
`;

const Container = () => (
    <ContainerWrapper>

    </ContainerWrapper>
);

export default Container;
